import React, { Component } from 'react'
import Slider from "react-slick";
import logo from "../../../assets/images/sacgd.png";

export default class Services extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: false,
            speed: 300,
            slidesToShow: 4,
            slidesToScroll: 4,
            autoplay: true,
            autoplaySpeed: 2000,
            arrows: true,
  responsive: [
    {
      breakpoint: 1024,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: true,
        dots: true
      }
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1
      }
    }
    // You can unslick at a given breakpoint now by adding:
    // settings: "unslick"
    // instead of a settings object
  ]
            
        };
        return (
            <>
                <div className='lore-ipm text-center mt-5 mb-5'>
                    <p>Lorem ipsum dolor</p>
                    <h1>Services</h1>
                </div>
                <div className="App">

                    <div className="slider-wrapper">

                    <Slider {...settings} className='slider'>

                           

                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>

                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>
                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>

                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>

                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>

                                <div className="slick-slide" key='5'>
                                    <h2 className="slick-slide-title">sd</h2>
                                    <img className="slick-slide-image" src={logo} />
                                    <label className="slick-slide-label">sdas</label>
                                </div>

                                

                        </Slider>

                    </div>

                </div>
            </>
        )
    }
}
